import React, { useState } from "react";
import { useContext, useEffect } from "react";

import { StyleSheet, Text, View, Button, ScrollView } from "react-native";
import PremadeItems from "../components/PremadeItems";

import TextItem1 from "../components/TextItem1";
import TextItem2 from "../components/TextItem2";
import TextItem3 from "../components/TextItem3";
import TextItem4 from "../components/TextItem4";
import TextItem5 from "../components/TextItem5";

import { DataContext } from "./../App";

export default function Market({ navigation }) {
  const { DataList1, DataList2, DataList3, DataList4, DataList5 } =
    useContext(DataContext);
  return (
    <View style={styles.container}>
      <View style={styles.marketSection}>
        <Text style={styles.headLine}>Live Market</Text>
        <ScrollView>
          {DataList1.map((text1, index) => (
            <TextItem1
              key={index}
              text1={text1.text1}
              dataDemand1={text1.dataDemand1}
              price1={text1.price1}
            />
          ))}
          {DataList2.map((text2, index) => (
            <TextItem2
              key={index}
              text2={text2.text2}
              dataDemand2={text2.dataDemand2}
              price2={text2.price2}
            />
          ))}
          {DataList3.map((text3, index) => (
            <TextItem3
              key={index}
              text3={text3.text3}
              dataDemand3={text3.dataDemand3}
              price3={text3.price3}
            />
          ))}
          {DataList4.map((text4, index) => (
            <TextItem4
              key={index}
              text4={text4.text4}
              dataDemand4={text4.dataDemand4}
              price4={text4.price4}
            />
          ))}
          {DataList5.map((text5, index) => (
            <TextItem5
              key={index}
              text5={text5.text5}
              dataDemand5={text5.dataDemand5}
              price5={text5.price5}
            />
          ))}

          {/* Premade Items */}
          {/* Kathryn Nelson */}
          <View style={styles.tile}>
            <Text style={styles.fontBigBold}>Seller: Kathryn Nelson</Text>
            <View style={styles.spaceBetween}>
              <Text style={styles.fontNormal}>Data: Menstrual cycles</Text>
              <Text style={styles.price}>$0.12</Text>
            </View>
            <br></br>
            {/* Input answer */}
            <View style={styles.spaceBetween}>
              <View style={styles.inputAnswer}>
                <Text style={styles.fontNormal}>
                  Regular with 5-day bleeding
                </Text>
              </View>
              {/* Buy button */}
              <View style={styles.buyButton}>
                <Text style={styles.fontNormalWhite}>Buy</Text>
              </View>
            </View>
            <Text style={styles.smallText}>4 hours ago</Text>
          </View>
          {/* Dwayne Keller */}
          <View style={styles.tile}>
            <Text style={styles.fontBigBold}>Seller: Dwayne Keller</Text>
            <View style={styles.spaceBetween}>
              <Text style={styles.fontNormal}>Data: Stock depositories</Text>
              <Text style={styles.price}>$0.28</Text>
            </View>
            <br></br>
            {/* Input answer */}
            <View style={styles.spaceBetween}>
              <View style={styles.inputAnswer}>
                <Text style={styles.fontNormal}>
                  $250,000 invested in Google
                </Text>
              </View>
              {/* Buy button */}
              <View style={styles.buyButton}>
                <Text style={styles.fontNormalWhite}>Buy</Text>
              </View>
            </View>
            <Text style={styles.smallText}>7 hours ago</Text>
          </View>
        </ScrollView>
      </View>
      <View style={styles.categoriesSection}>
        <Text style={styles.headLine}>Categories</Text>
        <View style={styles.categoryTile}>
          <Text style={styles.fontNormal}>Google searches</Text>
        </View>
      </View>
      <View style={styles.activitiesSection}></View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
    backgroundColor: "#FFFFFF",
    width: "100%",
    height: "100%",
  },

  //   Market section
  marketSection: {
    flex: 8,
    width: "100%",
    height: "100%",
    backgroundColor: "#FFFFFF",
    flexDirection: "column",
    padding: 40,
  },

  headLine: {
    fontSize: 30,
    fontWeight: "bold",
    marginBottom: 20,
  },

  // Categories section
  categoriesSection: {
    flex: 6,
    width: "100%",
    height: "100%",
    marginLeft: 20,
    backgroundColor: "#EFF5FD",
    flexDirection: "column",
    paddingLeft: 40,
    paddingTop: 40,
    paddingBottom: 40,
  },

  categoryTile: {
    alignItems: "flex-start",
    justifyContent: "center",
    width: "100%",
    height: 30,
    backgroundColor: "#B1CEEF",
  },

  //Activities section
  activitiesSection: {
    flex: 6,
    width: "100%",
    height: "100%",
    backgroundColor: "#E0EEFF",
    flexDirection: "column",
    paddingTop: 40,
    paddingBottom: 40,
  },

  //Premade items
  tile: {
    flexDirection: "column",
    alignItems: "flex-start",
    justifyContent: "center",
    width: "100%",
    backgroundColor: "#F4F7FB",
    borderRadius: 10,
    borderWidth: 1,
    padding: 20,
    marginBottom: 20,
  },

  spaceBetween: {
    flexDirection: "row",
    alignItems: "flex-start",
    justifyContent: "space-between",
    width: "100%",
  },

  fontBigBold: {
    lineHeight: 25,
    fontSize: 18,
    fontWeight: "bold",
  },

  fontNormal: {
    fontSize: 15,
  },

  price: {
    fontSize: 15,
    marginRight: 30,
    fontWeight: "bold",
  },

  fontNormalWhite: {
    fontSize: 15,
    color: "white",
    fontWeight: "bold",
  },

  inputAnswer: {
    alignItems: "flex-start",
    justifyContent: "center",
    width: "79%",
    backgroundColor: "white",
    borderRadius: 12,
    borderWidth: 1,
    height: 40,
    paddingLeft: 10,
  },

  buyButton: {
    alignItems: "center",
    justifyContent: "center",
    width: "19%",
    height: 40,
    backgroundColor: "#3B5B81",
    borderRadius: 12,
  },

  smallText: {
    marginTop: 8,
    fontSize: 12,
    fontStyle: "italic",
  },
});
